import React, { Component } from "react";

export default class FetchAPI extends Component {
  constructor() {
    super();
    this.state = {
      name: "",
    };
  }
  componentDidMount() {
    fetch("https://reqres.in/api/users?delay=3").then((res) => {
        res.json(this.setState({ name: result.data }))
    });
  }
  render() {
    return (
      <div>
        {this.state.name
          ? this.state.name.map((item, i) => (
              <p>
                {i}
                Email: {item.email}
                <br />
                Name:{item.first_name} {item.last_name}
                <br />
                avatar:{item.avatar}
              </p>
            ))
          : null}
      </div>
    );
  }
}
